import React from 'react';

function Sessions({ sessionSelection, toggleSlider }) {
    const sessions = ["Frontend Development", "Backend Development", "FullStack Development"];

    return (
        <div className="border rounded-xl text-sm mt-10 mx-5">
            {/* Header with tabs and filter options */}
            <div className="flex justify-between items-center px-5 py-3 border-b">
                <div className="flex space-x-6">
                    <button className="font-semibold text-gray-400">Mock Sessions</button>
                    <button className="font-semibold text-blue-500 border-b-2 border-blue-500">Mentorship Sessions</button>
                </div>
                <div className="flex space-x-2">
                    <button className="px-3 py-1 text-sm border rounded-full">Query Support</button>
                    <button className="px-3 py-1 text-sm border rounded-full">Others</button>
                    <button className="px-3 py-1 text-sm border rounded-full">HR Expert Sessions</button>
                    <button className="px-3 py-1 text-sm border rounded-full">Fundamentals</button>
                    <button className="px-3 py-1 text-sm border rounded-full">Frontend</button>
                    <button className="px-3 py-1 text-sm border rounded-full">DSA</button>
                    <button className="px-3 py-1 text-sm border rounded-full">Backend</button>
                </div>
            </div>

            {/* Session List */}
            <div className="">
                {sessions.map((session, index) => (
                    <div key={index} className="py-3 border-y flex justify-between px-5 items-center">
                        <span>{session}</span>
                        <p>Score</p>
                        <p>Last session</p>
                        <button className="text-blue-400 font-semibold" onClick={toggleSlider}>
                            View Details
                        </button>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Sessions;
